    data: |
      SELECT DISTINCT * FROM tab1 (FORMAT parquet) AS cor0 WHERE ( - col0 * col0 / col2 ) NOT IN ( + col0 / col1 + col1 );
  - name: tab1

outputs:
  - name: q3456.out
    data: |
      3	26	54
      64	10	57
      80	13	96
